import React from "react";
import Podaci from "./Podaci";
import Header from "./Header";

export default function Pocetna() {
  const [cart, setCartNum] = useState(0);
  return (
    <>
      <Header cart={cart} />
      <Podaci cartNum={setCartNum} />
    </>
  );
}
